import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first product card using a unique selector (use .product-card)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Find the first "Add to Cart" button inside the first product card
    const firstAddToCartBtn = await page.locator('//div[contains(@class,"product-card")][1]//button[contains(@class,"add-to-cart")]').first();
    await firstAddToCartBtn.waitFor({ timeout: 5000 });

    // Click the first "Add to Cart" button
    await firstAddToCartBtn.click();

    // Wait for notification to appear (using .notification.success)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_add_to_cart.png'));

    // Extract cart count from cart element (look for .cart and get the number before "Cart")
    await page.waitForSelector('.cart', { timeout: 5000 });
    const cartText = await page.$eval('.cart', el => el.textContent);
    // Extract the number (should be at the start)
    const cartCountMatch = cartText.match(/\d+/);
    const cartCount = cartCountMatch ? parseInt(cartCountMatch[0], 10) : null;

    // Return result
    return {
      success: true,
      action: "Added first product to cart and verified cart count increased",
      extractedData: {
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
